import React from 'react';
import { products } from '../../helper/data';

function ProductCard() {
  return (
    <div>
      {products.map(({ title, id, price, key, category, image }) => (
        <div key={id}>
          <h1>{title}</h1>
          <h1>{price}</h1>
          <h1>{category}</h1>
          <img src={image} alt={title} />
        </div>
      ))}
    </div>
  );
}

export default ProductCard;
